import React from 'react';
import './App.css';
// import 'pretty-checkbox';
class CodeCalender extends React.Component{
    constructor(props){
        super(props);
        this.state={
            result:{},
            ongoing:[],
            upcoming:[],

        };

    }
//    componentDidMount=()=>{
//        fetch('http://contesttrackerapi.herokuapp.com/android/').then((res)=>{
//            return res.json();
//        }).then((data)=>{
//         console.log(data)
//        })
//    }
    componentDidMount=()=>{
        this.getContestData();
    }
    getContestData=()=>{
       fetch('http://contesttrackerapi.herokuapp.com/android/').then((res)=>{
           return res.json();
       }).then((data)=>{
           console.log(data.result.ongoing);
           this.setState({
               ongoing : data.result.ongoing
           })
           console.log(data.result.upcoming);
           this.setState({
               upcoming:data.result.upcoming
           })
       })


   }

    render(){
        return(
            <div>
                <div className="chck">
                    <div class="custom-control custom-radio">
                            <input type="radio" class="custom-control-input" id="customRadio" name="example1"/>
                            <label class="custom-control-label" for="customRadio">Custom radio</label>
                            <input type="radio" class="custom-control-input" id="customRadio" name="example1"/>
                            <label class="custom-control-label" for="customRadio">Custom radio</label>
                            <input type="radio" class="custom-control-input" id="customRadio" name="example1"/>
                            <label class="custom-control-label" for="customRadio">Custom radio</label>
                    </div>

                </div>
                <div className="hack">
                    <div className="upcmng">
                      <h2>ONGOING CONTEST</h2>
                    </div>
                    {this.state.ongoing.map((data, index)=>(
                        <div className="oneBox">
                                <p>Name:{data.Name}</p>
                                <p>EndTime:{data.EndTime}</p>
                                <p>Platform:{data.Platform}</p>
                                {data.challenge_type ? ( <p>challenge_type:{data.challenge_type}</p>) : null}
                                <p>url:{data.url}</p>
                        </div>  

                    ))}
                </div>
                <div className="hack">
                        <div className="upcmng">
                            <h2>UPCOMING CONTEST</h2>
                        </div>
                    {this.state.upcoming.map((data, index)=>(
                        <div className="oneBox">
                                <p>Duration:{data.Duration}</p>
                                <p>EndTime:{data.EndTime}</p>
                                <p>Name:{data.Name}</p>
                                <p>Platform:{data.Platform}</p>
                                <p>StartTime:{data.StartTime}</p>
                                <p>url:{data.url}</p>
                        </div>
                    ))}
                </div>
            </div>
        );
    }
}
export default CodeCalender;
